import React, { useState } from "react";
import axios from "axios";

function Model() {
  const [file, setFile] = useState(null);

  function handleFileChange(event: any) {
    // Update the state with the selected file
    setFile(event.target.files[0]);
  }
  const handleUpload = () => {
    const formData = new FormData();

    // Update the formData object
    formData.append("myFile",file, file.name);

    // Details of the uploaded file

    // Request made to the backend api
    // Send formData object
    axios.post("api/uploadfile", formData);
    if (event.state.file) {
      return (
        <div>
          <h2>File Details:</h2>
          <p>File Name: {event.state.file.name}</p>
          <p>File Type: {event.state.file.type}</p>
          <p>
            Last Modified: {event.state.file.lastModifiedDate.toDateString()}
          </p>
        </div>
      );
    } else {
      return (
        <div>
          <br />
          <h4>Choose before Pressing the Upload button</h4>
        </div>
      );
    }
  };
  return (
    <div className="container upload mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <h5>File Upload</h5>
          <input
            type="file"
            className="form-control mb-3 custom-file-input"
            onChange={handleFileChange}
          />
          <a className="btn " onClick={handleUpload}>
            Upload
          </a>
        </div>
      </div>
    </div>
  );
}

export default Model;
